import logo from './logo.svg';
import './App.css';
import './Logo.css';

function App() {
  return (
    <div className="App">


    <button class="button" data-text="Awesome">
    <span class="actual-text">&nbsp;Canil&nbsp;Eduardo</span>
    <span aria-hidden="true" class="hover-text">&nbsp;Canil&nbsp;Eduardo</span>
    </button>

    <div className='entradas'>
      <form>
        <span>Data 
        <input type='date'></input>
        </span>

        <span><br></br>Digite a quantidade de c達es grandes <br></br><input></input></span>
        <span>Digite a quantidade de c達es pequenos <br></br><input></input></span>

      </form>


      {/* <input placeholder='Quantidade de c達es pequenos'></input>
      <input placeholder='Quantidade de c達es grandes'></input> */}
      </div>
      <div className='result'>
        <span> Bloco resultado</span>
      </div>

    </div>


  );
}

export default App;
